import { Button, Col } from 'react-bootstrap';
import '../App.css';
export default function Welcome() {
  return (
   <Col lg="4" className='bg-primary mt-2 mb-4 p-2  rounded '>
        <h3 className='d-inline '>Bienvenido Gabriel</h3><Button variant='danger'>Out</Button>
   </Col>
  )
}
